// TeamDetails.js

import React from 'react';
import classes from './team.module.css';
import s1 from './ppl.jpg';
import s2 from './ppl1.jpg';
import s3 from './ppl2.jpg';
import s4 from './ppl3.jpg';

const TeamDetails = () => {

  const teamMembers = [
    { id: 1, name: 'John Doe', role: 'CEO', image: s1 },
    { id: 2, name: 'Jane Smith', role: 'Manager', image: s2 },
    { id: 3, name: 'Mike Johnson', role: 'HR', image: s3 },
    { id: 4, name: 'Emily Brown', role: 'Head Engineer', image: s4 },
    // Add more team members as needed
  ];

  return (
    <div className={classes.teamdetails}>
      <h1>Our Team</h1>
      <div className={classes.teammembers}>
        {teamMembers.map(member => (
          <div key={member.id} className={classes.teammember}>
            <img src={member.image} alt={member.name} className={classes.memberimage} />
            <h2>{member.name}</h2>
            <p>{member.role}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default TeamDetails;
